import Button from '@material-ui/core/Button';
import React from 'react';
import { useHistory } from 'react-router';
import '../../styles/Registration.css';

function Registration() {

   const history = useHistory();

   return (
      <div>
         <div className="container">
            <div className="horizontal-center">
               <h2>Želite li se registrirati kao građanin ili udruga?</h2>
            </div>
            <div className="container">
               <div className="horizontal-center">
                  <span className="margin">
                     <Button variant="contained" onClick={() => history.push("/registration/citizen")}>Građanin</Button>
                  </span>
                  <span className="margin">
                     <Button variant="contained" onClick={() => history.push("/registration/association")}>Udruga</Button>
                  </span>
               </div>
            </div>
         </div>
      </div>
   );
}

export default Registration;
